import { base_url } from './base_url'
import axios from 'axios'

export const editUser = (data) => {

  return axios.put(`${base_url}/profile/${data._id}`, data)
    .then(response => response.data, console.log('entro'))
    .catch((err) => {
      throw err
    })
}
